// src/components/Home.jsx
import React, { useEffect, useRef, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Home.css';

function AutoImagePanel({ images = [], interval = 4000, ariaLabel = 'Hero images' }) {
  const [index, setIndex] = useState(0);
  const refPaused = useRef(false);
  const timerRef = useRef(null);

  useEffect(() => {
    startTimer();
    return stopTimer;
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [index]);

  function startTimer() {
    stopTimer();
    timerRef.current = setInterval(() => {
      if (!refPaused.current) {
        setIndex(i => (i + 1) % images.length);
      }
    }, interval);
  }

  function stopTimer() {
    if (timerRef.current) {
      clearInterval(timerRef.current);
      timerRef.current = null;
    }
  }

  if (!images || images.length === 0) return null;

  return (
    <div
      className="auto-image-panel"
      role="img"
      aria-label={ariaLabel}
      onMouseEnter={() => { refPaused.current = true; }}
      onMouseLeave={() => { refPaused.current = false; }}
    >
      <div className="auto-image-inner" style={{ transform: `translateX(-${index * 100}%)` }}>
        {images.map((src, i) => (
          <div className="auto-image-slide" key={i}>
            <img src={src} alt={`illustration ${i + 1}`} className="auto-image-img" />
          </div>
        ))}
      </div>

      <div className="auto-image-dots" aria-hidden="true">
        {images.map((_, i) => (
          <button
            key={i}
            className={`dot ${i === index ? 'active' : ''}`}
            onClick={() => setIndex(i)}
            aria-label={`Show image ${i + 1}`}
          />
        ))}
      </div>
    </div>
  );
}

export default function Home() {
  const navigate = useNavigate();

  const handleGetStarted = () => {
    navigate('/analysis-selection');
  };

  // list of hero images for the automated panel
  const heroImages = [
    '/images/home_page.png',
    '/images/home_page.png',
    '/images/home_page.png'
  ];

  return (
    <main className="pf-page home-page">
      <div className="pf-hero connected-hero">
        <div className="pf-hero-left">
          <h1 className="pf-title-main">InsightFlow — Professional Analytics</h1>

          <p className="pf-lead">
InsightFlow helps you unlock the full potential of your data by transforming ordinary
spreadsheets into meaningful, decision-ready intelligence.
Our automated engine processes your files, identifies key patterns, and highlights insights
that would otherwise take hours of manual work to uncover.
Whether you're analyzing energy usage, financial metrics, operational trends, or custom
datasets, InsightFlow brings clarity and structure to every analysis.
Make faster decisions, reduce workloads, and empower your team with insights that truly matter.
          </p>

          <div className="pf-hero-actions">
            <button
              onClick={handleGetStarted}
              className="btn-get-started"
            >
              Get Started →
            </button>
          </div>
        </div>

        {/* Replaces the old pf-hero-right / stats card */}
        <div className="pf-hero-right">
          <AutoImagePanel images={heroImages} interval={4000} />
        </div>
      </div>

      {/* features moved near footer (unchanged) */}
      <section className="pf-features pf-features-bottom">
        <article className="pf-feature-card">
          <div className="feature-image-wrapper">
            <img
              src="/images/secure_by_design.png"
              alt="Secure by design"
              className="feature-image"
            />
            <div className="feature-text">
              <h3>Secure by design</h3>
              <p>Role-based access control, SSO-ready, and encrypted storage.</p>
            </div>
          </div>
        </article>

        <article className="pf-feature-card">
          <div className="feature-image-wrapper">
            <img
              src="/images/shareable_reports.png"
              alt="Shareable reports"
              className="feature-image"
            />
            <div className="feature-text">
              <h3>Shareable reports</h3>
              <p>Export PDF or schedule automated email reports for stakeholders.</p>
            </div>
          </div>
        </article>

        <article className="pf-feature-card">
          <div className="feature-image-wrapper">
            <img
              src="/images/ai_driven_insights.png"
              alt="AI-driven insights"
              className="feature-image"
            />
            <div className="feature-text">
              <h3>AI-driven insights</h3>
              <p>Auto-detect anomalies and get suggested actions.</p>
            </div>
          </div>
        </article>
      </section>

    </main>
  );
}
